import { Link } from "react-router-dom";


const NavBar = () => {
    return (
        <div>
            <ul class="nav nav-pills">
                <li class="nav-item">
                    <Link to="/"><a class="nav-link active">Home</a></Link>
                </li>
                <li class="nav-item">
                    <Link to="/login"><a class="nav-link">Login</a></Link>
                </li>
                <li class="nav-item">
                    <Link to="/logOut"><a class="nav-link">logOut</a></Link>
                </li>
                <li class="nav-item">
                    <Link to="/register"><a class="nav-link" href="#">Sign up</a></Link>
                </li>
            </ul>
        </div>
    )
};

export default NavBar;
